#include <stdlib.h>
#include <stdbool.h>



typedef struct {
    struct TreeNode** stack;
    int top;
    int capacity;
} BSTIterator;

void push(BSTIterator* iter, struct TreeNode* node) {
    if (iter->top == iter->capacity - 1) {
        iter->capacity *= 2;
        iter->stack = realloc(iter->stack, iter->capacity * sizeof(struct TreeNode*));
    }
    iter->stack[++iter->top] = node;
}

struct TreeNode* pop(BSTIterator* iter) {
    return iter->stack[iter->top--];
}

BSTIterator* bSTIteratorCreate(struct TreeNode* root) {
    BSTIterator* iter = malloc(sizeof(BSTIterator));
    iter->capacity = 10;
    iter->stack = malloc(iter->capacity * sizeof(struct TreeNode*));
    iter->top = -1;

    // Push all left nodes onto the stack
    while (root != NULL) {
        push(iter, root);
        root = root->left;
    }

    return iter;
}

int bSTIteratorNext(BSTIterator* obj) {
    struct TreeNode* node = pop(obj);
    int result = node->val;

    // Push all left nodes of the right subtree
    node = node->right;
    while (node != NULL) {
        push(obj, node);
        node = node->left;
    }

    return result;
}

bool bSTIteratorHasNext(BSTIterator* obj) {
    return obj->top != -1;
}

void bSTIteratorFree(BSTIterator* obj) {
    free(obj->stack);
    free(obj);
}

